import React from 'react'
import data from './users.json'
import UserItem from './UserItem.js';
import AverageAge from './AverageAge.js';

const UserList = () => {
   // console.log(result)
   const average = () => {
      let age = 0;
      var count = 0;
      // let result = ''
      data.map((item) => {

         if (item.role === 'admin') {

            count++;
         }
      })
      data.map((item) => {

         if (item.role === 'admin') {
            age += item.age / count
         }

      })
      return age
   }
   return (
      <div >
         {data.map((users) => {
            return (
               (users.role === 'user' ?
                  <UserItem name={users.name} />
                  : ''
               )
            )
         })}
         <AverageAge average={average()} />
      </div>)
}

export default UserList
